import React, {useState} from 'react';

const App = () => {

  const [info, setInfo] = useState({"ml": "LinearRegression", "nb": 1.0, "sizedb": 1.0, "pourcentage": 0.0})
  const [test, setTest] = useState(true)

  if (test == true) {
    setTest(false)
    setInfo({"ml": "LinearRegression", "nb": 1.0, "sizedb": 1.0, "pourcentage": 0.0})
  }

  return (
    <div>
      <p> Sizedb: {info.sizedb} </p>
    </div>
  );
};

export default App;
